import React,{useState} from 'react';
import Chart from 'react-apexcharts';

function ReportCharts() {
    const [data, setData] = useState({
        series: [
            {
                name: 'Sales',
                data: [30, 40, 28, 50, 82, 98],
            },
            {
                name: 'Revenue',
                data: [30, 11, 28, 61, 82, 10],
            },
            {
                name: 'Customers',
                data: [30, 11, 28, 81, 18, 10],
            },
        ],
        options: {
            chart: {
                height: 350,
                type: 'area',
                toolbar: {
                    show: false,
                },
            },
            markers: {
                size: 4,
            },
            colors: ['#4154f1', '#2eca6a', '#ff771d'], // Correctly formatted color codes
            fill: {
                type: 'gradient',
                gradient: {
                    shade: 'light', // Example property
                    type: 'vertical', // Example property
                    gradientToColors: ['#4154f1', '#2eca6a', '#ff771d'], // Optional gradient end colors
                    opacityFrom: 0.7, // Example property
                    opacityTo: 0.5, // Example property
                    side
                },
            },
        },
    });
  return (
    <div>ReportCharts</div>
  )
}

export default ReportCharts
